        <span style={{ fontWeight: "bold" }}>Slot Machine game🎰 </span>
      </h1>
      <Slotm x="👍" y="👍" z="😢" />
      <Slotm x="😘" y="" z="💖" />
      <Slotm x="💋" y="🎰" z="🎉" />
    </>
  );
};
export default App;
